import {
  HashRouter as Router,
  Route,
  Routes
} from "react-router-dom";


import './App.css';
import Navb from './components/Navb';
import NotesListPage from './components/Notes';
import NotePage from './components/NotePage';

function App() {
  return (
    <Router>
      <Navb />
      <div className="container dark">
        <div className="app">
          <Routes>
            <Route path="/" exact component={NotesListPage} element={NotesListPage} />
            <Route path="/note/:id" exact component={NotePage} />
          </Routes>
        </div>
      </div>
    </Router>
  );
}

export default App;
